import React,{useEffect} from "react";
import Card from '../Card/card'
import { useDispatch, useSelector } from 'react-redux';
import { useHistory } from 'react-router-dom';
import { getAllProducts } from '../../Redux/Actions/get_products';

export default function Home(props){
    const dispatch = useDispatch();
    const products = useSelector( state => state.products)
    const history = useHistory()
    let path = history.location.pathname

    useEffect(() => { 
        if("/") dispatch(getAllProducts());    
        return
    },[dispatch])

    return(
        products[0] && products[0].price ? <div className="homeContainerss">
                { products.map(a => a.stock < 1 ? null : <Card key={a.id} id={a.id} name={a.name} stock={a.stock} image={a.image} price={a.price} />) }
            </div>
: null)
}
